function initMap() {
	var e = {
			lat: 22.5932759,
			lng: 88.27027720000001
		},
		t = new google.maps.Map(document.getElementById("map-canvas"), {
			zoom: 15,
			center: e,
			scrollwheel: !1
		});
	new google.maps.Marker({
		position: e,
		map: t
	})
}

